const PIECES = "TIJLOSZ";


function sortByPCOrder(a: string, b: string) {
    return PIECES.indexOf(a) - PIECES.indexOf(b);
}

function normalizeInput(input: string): string {
    let cleaned = input.replace(/[\s,&]/g, "");

    // 1. Handle inversion: [^XYZ] → [complement]
    cleaned = cleaned.replace(/\[\^([A-Z]+)\]/g, (_, negated) => PIECES.split("").filter(c => !negated.includes(c)).join(""));

    // 2. Replace [*...] → [expanded]
    cleaned = cleaned.replace(/\[([^\]]*?)\]/g, (_, inner) => {
        const expanded = inner.replace(/\*/g, PIECES);
        return `[${expanded}]`;
    });

    // 3. Replace lone * outside of brackets with placeholder (space between for safety)
    cleaned = cleaned.replace(/\*/g, ` [${PIECES}]p1 `);

    // 4. Replace [XYZ]! → [XYZ]pN
    cleaned = cleaned.replace(/\[([A-Z]+)\]!/g, (_, bag) => `[${bag}]p${bag.length}`);

    // 5. Replace [XYZ]N → [XYZ]pN
    cleaned = cleaned.replace(/\[([A-Z]+)\](\d)/g, (_, bag, n) => `[${bag}]p${n}`);

    // 6. Replace bare [XYZ] → [XYZ]p1
    cleaned = cleaned.replace(/\[([A-Z]+)\](?![pc]\d)/g, (_, bag) => `[${bag}]p1`);

    // 7. Convert ABCp2 → [ABC]p2
    cleaned = cleaned.replace(/([A-Z]+)([pc])(\d)/g, (_, bag, mode, n) => `[${bag}]${mode}${n}`);

    // 8. Remove extra spaces and fix p1p3, etc.
    cleaned = cleaned.replace(/\s+/g, "");
    cleaned = cleaned.replace(/p1([pc]\d)/g, `p1 $1`).replace(/\s+/g, "");

    return cleaned;
}




function getPermutations(str: string, length: number): string[] {
    const results: Set<string> = new Set();
    const chars = str.split('').sort(); // Sort to make deduplication easier

    function backtrack(path: string[], used: boolean[]) {
        if (path.length === length) {
            results.add(path.join(""));
            return;
        }

        for (let i = 0; i < chars.length; i++) {
            if (used[i]) continue;
            // Skip duplicates
            if (i > 0 && chars[i] === chars[i - 1] && !used[i - 1]) continue;

            used[i] = true;
            path.push(chars[i]);
            backtrack(path, used);
            path.pop();
            used[i] = false;
        }
    }

    backtrack([], Array(str.length).fill(false));
    return Array.from(results);
}


function getCombinations(str: string, length: number): string[] {
    const sorted = [...str].sort(sortByPCOrder);
    const results: string[] = [];

    function backtrack(start: number, path: string[]) {
        if (path.length === length) {
            results.push(path.join(""));
            return;
        }
        for (let i = start; i < sorted.length; i++) {
            path.push(sorted[i]);
            backtrack(i + 1, path);
            path.pop();
        }
    }

    backtrack(0, []);
    return results;
}

export default function pieces(input: string): string[] {
    input = normalizeInput(input);
